import { useState } from 'react';
import {
  Box,
  Button,
  Card,
  CardContent,
  Typography,
  Chip,
  Grid,
  Divider,
  Link
} from '@mui/material';
import axios from 'axios';

const endpointMapping = {
  'Notion': 'notion',
  'Airtable': 'airtable',
  'HubSpot': 'hubspot',
};

export const DataForm = ({ integrationType, credentials }) => {
  const [loadedData, setLoadedData] = useState(null);
  const [loading, setLoading] = useState(false);
  const endpoint = endpointMapping[integrationType];

  const handleLoad = async () => {
    try {
      setLoading(true);
      const formData = new FormData();
      formData.append('credentials', JSON.stringify(credentials));
      const response = await axios.post(`http://localhost:8000/integrations/${endpoint}/load`, formData);
      const data = response.data;
      setLoadedData(data);
      setLoading(false);
    } catch (e) {
      alert(e?.response?.data?.detail);
      setLoading(false);
    }
  };

  const renderHubSpotData = () => {
    if (!loadedData || !Array.isArray(loadedData)) return null;

    // Group by type
    const contacts = loadedData.filter(item => item.type === 'contact');
    const companies = loadedData.filter(item => item.type === 'company');
    const deals = loadedData.filter(item => item.type === 'deal');

    return (
      <Box sx={{ mt: 3 }}>
        <Typography variant="h5" sx={{ mb: 2, fontWeight: 'bold' }}>
          üìä HubSpot Data Summary
        </Typography>

        <Grid container spacing={2} sx={{ mb: 3 }}>
          <Grid item xs={4}>
            <Card sx={{ backgroundColor: '#e3f2fd' }}>
              <CardContent>
                <Typography variant="h4" sx={{ fontWeight: 'bold', color: '#1976d2' }}>
                  {contacts.length}
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  üë§ Contacts
                </Typography>
              </CardContent>
            </Card>
          </Grid>
          <Grid item xs={4}>
            <Card sx={{ backgroundColor: '#f3e5f5' }}>
              <CardContent>
                <Typography variant="h4" sx={{ fontWeight: 'bold', color: '#7b1fa2' }}>
                  {companies.length}
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  üè¢ Companies
                </Typography>
              </CardContent>
            </Card>
          </Grid>
          <Grid item xs={4}>
            <Card sx={{ backgroundColor: '#e8f5e9' }}>
              <CardContent>
                <Typography variant="h4" sx={{ fontWeight: 'bold', color: '#388e3c' }}>
                  {deals.length}
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  üí∞ Deals
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        </Grid>

        {/* Contacts Section */}
        {contacts.length > 0 && (
          <Box sx={{ mb: 3 }}>
            <Typography variant="h6" sx={{ mb: 2, fontWeight: 'bold' }}>
              üë§ Contacts ({contacts.length})
            </Typography>
            <Grid container spacing={2}>
              {contacts.map((contact, index) => (
                <Grid item xs={12} sm={6} md={4} key={index}>
                  <Card sx={{ height: '100%', '&:hover': { boxShadow: 6 } }}>
                    <CardContent>
                      <Chip label="Contact" size="small" color="primary" sx={{ mb: 1 }} />
                      <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 1 }}>
                        {contact.name}
                      </Typography>
                      <Typography variant="body2" color="textSecondary" sx={{ mb: 0.5 }}>
                        ID: {contact.id}
                      </Typography>
                      {contact.creation_time && (
                        <Typography variant="body2" color="textSecondary" sx={{ mb: 1 }}>
                          Created: {new Date(contact.creation_time).toLocaleDateString()}
                        </Typography>
                      )}
                      {contact.url && (
                        <Link href={contact.url} target="_blank" rel="noopener" sx={{ fontSize: '0.875rem' }}>
                          View in HubSpot ‚Üí
                        </Link>
                      )}
                    </CardContent>
                  </Card>
                </Grid>
              ))}
            </Grid>
          </Box>
        )}

        {/* Companies Section */}
        {companies.length > 0 && (
          <Box sx={{ mb: 3 }}>
            <Typography variant="h6" sx={{ mb: 2, fontWeight: 'bold' }}>
              üè¢ Companies ({companies.length})
            </Typography>
            <Grid container spacing={2}>
              {companies.map((company, index) => (
                <Grid item xs={12} sm={6} md={4} key={index}>
                  <Card sx={{ height: '100%', '&:hover': { boxShadow: 6 } }}>
                    <CardContent>
                      <Chip label="Company" size="small" color="secondary" sx={{ mb: 1 }} />
                      <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 1 }}>
                        {company.name}
                      </Typography>
                      <Typography variant="body2" color="textSecondary" sx={{ mb: 0.5 }}>
                        ID: {company.id}
                      </Typography>
                      {company.creation_time && (
                        <Typography variant="body2" color="textSecondary" sx={{ mb: 1 }}>
                          Created: {new Date(company.creation_time).toLocaleDateString()}
                        </Typography>
                      )}
                      {company.url && (
                        <Link href={company.url} target="_blank" rel="noopener" sx={{ fontSize: '0.875rem' }}>
                          View in HubSpot ‚Üí
                        </Link>
                      )}
                    </CardContent>
                  </Card>
                </Grid>
              ))}
            </Grid>
          </Box>
        )}

        {/* Deals Section */}
        {deals.length > 0 && (
          <Box sx={{ mb: 3 }}>
            <Typography variant="h6" sx={{ mb: 2, fontWeight: 'bold' }}>
              üí∞ Deals ({deals.length})
            </Typography>
            <Grid container spacing={2}>
              {deals.map((deal, index) => (
                <Grid item xs={12} sm={6} md={4} key={index}>
                  <Card sx={{ height: '100%', '&:hover': { boxShadow: 6 } }}>
                    <CardContent>
                      <Chip label="Deal" size="small" color="success" sx={{ mb: 1 }} />
                      <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 1 }}>
                        {deal.name}
                      </Typography>
                      <Typography variant="body2" color="textSecondary" sx={{ mb: 0.5 }}>
                        ID: {deal.id}
                      </Typography>
                      {deal.creation_time && (
                        <Typography variant="body2" color="textSecondary" sx={{ mb: 1 }}>
                          Created: {new Date(deal.creation_time).toLocaleDateString()}
                        </Typography>
                      )}
                      {deal.url && (
                        <Link href={deal.url} target="_blank" rel="noopener" sx={{ fontSize: '0.875rem' }}>
                          View in HubSpot ‚Üí
                        </Link>
                      )}
                    </CardContent>
                  </Card>
                </Grid>
              ))}
            </Grid>
          </Box>
        )}

        <Divider sx={{ my: 3 }} />

        {/* Raw JSON (collapsible) */}
        <details>
          <summary style={{ cursor: 'pointer', fontWeight: 'bold', marginBottom: '10px' }}>
            üìÑ View Raw JSON Data
          </summary>
          <Box sx={{ 
            backgroundColor: '#f5f5f5', 
            p: 2, 
            borderRadius: 1, 
            overflow: 'auto',
            maxHeight: '400px',
            fontFamily: 'monospace',
            fontSize: '0.875rem'
          }}>
            <pre>{JSON.stringify(loadedData, null, 2)}</pre>
          </Box>
        </details>
      </Box>
    );
  };

  const renderOtherData = () => {
    return (
      <Box sx={{ mt: 2 }}>
        <Typography variant="h6" sx={{ mb: 2 }}>
          Loaded Data:
        </Typography>
        <Box sx={{ 
          backgroundColor: '#f5f5f5', 
          p: 2, 
          borderRadius: 1, 
          overflow: 'auto',
          maxHeight: '500px',
          fontFamily: 'monospace',
          fontSize: '0.875rem'
        }}>
          <pre>{JSON.stringify(loadedData, null, 2)}</pre>
        </Box>
      </Box>
    );
  };

  return (
    <Box>
      <Box sx={{ display: 'flex', gap: 2, mt: 2 }}>
        <Button 
          onClick={handleLoad} 
          variant='contained' 
          disabled={loading}
        >
          {loading ? 'Loading...' : 'Load Data'}
        </Button>
        {loadedData && (
          <Button 
            onClick={() => setLoadedData(null)} 
            variant='outlined'
          >
            Clear Data
          </Button>
        )}
      </Box>

      {loadedData && (
        integrationType === 'HubSpot' 
          ? renderHubSpotData() 
          : renderOtherData()
      )}
    </Box>
  );
};
